import React, { useState } from 'react';
import UDPComponent from './Components/UDPComponent';
import './App.css';

const App = () => {
  const [targetIP, setTargetIP] = useState('127.0.0.1');
  const [targetPort, setTargetPort] = useState(60002); // Different port for target
  const [sourcePort, setSourcePort] = useState(60001); // Different port for source

  const [sourceToTargetLoss, setSourceToTargetLoss] = useState(0.2);
  const [targetToSourceLoss, setTargetToSourceLoss] = useState(0.2);
  const [sourceDelay, setSourceDelay] = useState(0);
  const [targetDelay, setTargetDelay] = useState(0);

  return (
    <div>
      <div>
        <label>
          Target IP:
          <input type="text" value={targetIP} onChange={(e) => setTargetIP(e.target.value)} />
        </label>
        <label>
          Target Port:
          <input type="number" value={targetPort} onChange={(e) => setTargetPort(e.target.value)} />
        </label>
        <label>
          Source Port:
          <input type="number" value={sourcePort} onChange={(e) => setSourcePort(e.target.value)} />
        </label>
      </div>
      <UDPComponent
        localPort={sourcePort}
        proxyHost={targetIP}
        proxyPort={targetPort}
        direction="source"
        sourceToTargetLoss={sourceToTargetLoss}
        targetToSourceLoss={targetToSourceLoss}
        sourceDelay={sourceDelay}
        targetDelay={targetDelay}
      />
      <UDPComponent
        localPort={targetPort}
        proxyHost={targetIP}
        proxyPort={sourcePort}
        direction="target"
        sourceToTargetLoss={sourceToTargetLoss}
        targetToSourceLoss={targetToSourceLoss}
        sourceDelay={sourceDelay}
        targetDelay={targetDelay}
      />
    </div>
  );
};

export default App;
